          display: "block",
          margin: "0 auto 10px",
          maxHeight: "200px",
        }}
        className="img-fluid"
        alt="prdImg"
        src="https://scdn.line-apps.com/n/line_add_friends/btn/zh-Hant.png"
      />
      <p>波士頓蛋糕</p>
      <h4 className="text-left"> $ 250 </h4>
      <button href="#" className="btn btn-primary">
        Add to cart
      </button>
    </div>
  );
};

export default ProductItem;
